import { useState, useEffect } from "react";

function App() {

  useEffect(() => {
    fetch('http://localhost:3500/users')
    .then(response => response.json())
    .then(data => console.log(data))
  });

  function newUser(user,pwd){
    fetch('http://localhost:3500/register')
    .then(response => response.json())
    .then(data => console.log(data))
  }



  return (
    <div className="App">
      <h1>dss</h1>
    </div>
  );
}

export default App;
